import React from 'react';
import Card from './Card';

const CardList = ({ Cats }) => {
	const cardArray = Cats.map((user, i) => {
		return <Card id={Cats[i].id} name={Cats[i].name} email={Cats[i].email}/>
	})
	return (
			<div>
				{cardArray}
			</div>
		)
}

export default CardList;
